import React, { Component } from "react";

class Navbar extends Component {
  state = {};

  generateId() {
    return Math.random()
      .toString(36)
      .substr(2, 9);
  }

  render() {
    return (
      <nav className={this.props.navCls}>
        <ul>
          {this.props.options.map((option, index) => {
            return (
              <li className={this.props.navOptionCls} key={this.generateId()}>
                {!!option.title ? option.title : "Section " + (index + 1)}
                <div className={this.props.navDotCls}></div>
              </li>
            );
          })}
        </ul>
      </nav>
    );
  }
}

export default Navbar;
